    var price_header = "<th>" + (side == 'buy' ? "Bid" : "Ask") + "<p class='contract_unit'></p> </th>";
    var volume_header = "<th>Volume</th>";

    $(id).prepend("<tr>" + (side == 'buy' ? volume_header + price_header : price_header + volume_header) + "</tr>");

